(19243, '', '', 'Sayges Horoskop Nr. 8', '', '', '', '', '', NULL, NULL, 'Ihr werdet ein Vermögen erhalten.', NULL, NULL, NULL, NULL, NULL),
(19244, '', '', 'Sayges Horoskop Nr. 9', '', '', '', '', '', NULL, NULL, 'Eure erste und letzte Liebe ist Eigenliebe.', NULL, NULL, NULL, NULL, NULL),
(19245, '', '', 'Sayges Horoskop Nr. 10', '', '', '', '', '', NULL, NULL, 'Ruhe ist eine gute Sache, doch Langweile ist dessen Bruder.', NULL, NULL, NULL, NULL, NULL),
(19246, '', '', 'Sayges Horoskop Nr. 10', '', '', '', '', '', NULL, NULL, 'Diejenigen, die einen einfachen Geschmack haben, sind immer mit dem Besten zufrieden.', NULL, NULL, NULL, NULL, NULL),
(19247, '', '', 'Sayges Horoskop Nr. 12', '', '', '', '', '', NULL, NULL, 'Lasst Euch nicht von den Fluten des Krieges hinwegspülen.', NULL, NULL, NULL, NULL, NULL),
(19248, '', '', 'Sayges Horoskop Nr. 13', '', '', '', '', '', NULL, NULL, 'Ihr macht Eure Gegner sprachlos.', NULL, NULL, NULL, NULL, NULL),
(19249, '', '', 'Sayges Horoskop Nr. 14', '', '', '', '', '', NULL, NULL, 'Ihr habt einen guten Riecher für Heuchlerei.', NULL, NULL, NULL, NULL, NULL),
(19250, '', '', 'Sayges Horoskop Nr. 15', '', '', '', '', '', NULL, NULL, 'So manch einer lernt mehr, wenn er andere unterrichtet.', NULL, NULL, NULL, NULL, NULL),
(19251, '', '', 'Sayges Horoskop Nr. 16', '', '', '', '', '', NULL, NULL, 'Ihr werdet bald eine dringliche Entscheidung fällen müssen.', NULL, NULL, NULL, NULL, NULL),
(19252, '', '', 'Sayges Horoskop Nr. 18', '', '', '', '', '', NULL, NULL, 'Nehmt den nächsten Vorschlag an, der Euch zu Ohren kommt.', NULL, NULL, NULL, NULL, NULL),
(19253, '', '', 'Sayges Horoskop Nr. 17', '', '', '', '', '', NULL, NULL, 'Stoßt einen Gnom niemals grundlos an.', NULL, NULL, NULL, NULL, NULL),
(19254, '', '', 'Sayges Horoskop Nr. 21', '', '', '', '', '', NULL, NULL, 'Gottesschilder und Ruhesteine machen einen Helden nicht heldenhaft.', NULL, NULL, NULL, NULL, NULL),
(19255, '', '', 'Sayges Horoskop Nr. 22', '', '', '', '', '', NULL, NULL, 'Eine blaue Antwort ist immer eine schlaue Antwort.', NULL, NULL, NULL, NULL, NULL),
